description:
The early 80s saw the creation of numerous great X rated films and the solidifying of sexually explicit films being comparable to, in many cases, the best low budget films of the time. Shaun Costello (under his Warren Evans pseudonym) created some of the finest and most unique X rated movies produced on the East Coast among them this simple, yet lavish retelling of Beauty &amp; The Beast.

